import "./App.css";
import "./styles.css";
import Carousel from 'react-bootstrap/Carousel';
import "bootstrap/dist/js/bootstrap.bundle.min";

function App() {
  return (
    <div className="App">
      <Header />
      <Menu />
      <Mangas />
    </div>
  );
}

function Header() {
  return (
    <div className="logo">
      <img src="lezhin.png" alt="Lezhin Logo" />;
    </div>
  );
}

function Menu() {
  return (
    <div className="menu">
      <ul>
        <button className="btn2">RECENT</button>
        <button className="btn2">SUBSCRIBED</button>
        <button className="btn2">DOWNLOADS</button>
        <button className="btn2">UNLOCKED</button>
        <button className="btn2">CREATORS</button>
        <button className="btn2">COMMENTS</button>
      </ul>
    </div>
  );
}

function Mangas() {
  return (
    <div
      id="carouselExampleIndicators"
      class="carousel slide"
      data-ride="carousel"
    >
      <ol class="carousel-indicators">
        <li
          data-target="#carouselExampleIndicators"
          data-slide-to="0"
          class="active"
        ></li>
        <li data-target="#carouselExampleIndicators" data-slide-to="1"></li>
        <li data-target="#carouselExampleIndicators" data-slide-to="2"></li>
      </ol>
      <div class="carousel-inner">
        <div class="carousel-item active">
          <img class="d-block w-100" src="..." alt="First slide"></img>
        </div>
        <div class="carousel-item">
          <img class="d-block w-100" src="..." alt="Second slide">
            {" "}
          </img>
        </div>
        <div class="carousel-item">
          <img class="d-block w-100" src="..." alt="Third slide">
            {" "}
          </img>
        </div>
      </div>
      <a
        class="carousel-control-prev"
        href="#carouselExampleIndicators"
        role="button"
        data-slide="prev"
      >
        <span class="carousel-control-prev-icon" aria-hidden="true"></span>
        <span class="sr-only">Previous</span>
      </a>
      <a
        class="carousel-control-next"
        href="#carouselExampleIndicators"
        role="button"
        data-slide="next"
      >
        <span class="carousel-control-next-icon" aria-hidden="true"></span>
        <span class="sr-only">Next</span>
      </a>
    </div>
  );
}

export default App;
